import React from "react";
import {
  AccWrapper,
  AccContainer,
  AccBar,
  AccInfoContainer,
} from "./AccElements";

const Account = () => {
  return (
    <>
      <AccWrapper>
        <AccContainer>
          <AccBar>
            <AccPhContainer></AccPhContainer>
          </AccBar>
          <AccInfoContainer></AccInfoContainer>
        </AccContainer>
      </AccWrapper>
    </>
  );
};

export default Account;
